AND  ("pd"."tanggal_keluar" is NULL OR "lp"."tindak_lanjut" = 'cco sementara' ) 
AND "b"."id" = 'undefined'
ORDER BY "lp"."id" DESC, "lp"."tanggal_layanan" DESC
 LIMIT 10
